import React from "react";

const RedirectAcount = (props) => {
  return (
    <div
      className="flex justify-between flex-col rounded-xl shadow-xl border-1 border-red-500 h-60 w-80 m-4 cursor-pointer"
      style={{
        backgroundImage: `url(${props.image})`,
        backgroundRepeat: "none",
        backgroundPosition: "center",
        backgroundSize: "cover",
      }}
    >
      <h2 className="m-3 text-center font-semibold text-xl font-sans">
        {props.title}
      </h2>
      <a
        href={props.link}
        className="text-blue-400 m-3 text-center cursor-pointer"
      >
        {props.text}
      </a>
    </div>
  );
};

export default RedirectAcount;
